import React from 'react';
import s from './order_Shop.module.css'

const Order_Shop = () => {
    return (
        <div className={s.grid}>
            <div className={s.grid1}>a<br />dddd</div>              
            <div className={s.grid2}>b</div>              
            <div className={s.grid2}>c</div>              
            <div className={s.grid3}>d</div>              
        </div>
    )
}
export default Order_Shop;
